import React from "react";

import styles from "./Button.css";

const Button = ({ buttonText, onClick, color, size }) => {
  const buttonStyle = {
    // ...other styles

    backgroundColor: color,

    padding: size === "large" ? "15px 30px" : "10px 20px",
  };

  return (
    <button style={buttonStyle} onClick={onClick}>
      {buttonText}
    </button>
  );
};
